CREATE TABLE seq(
    `name` VARCHAR(20) NOT NULL   COMMENT 'name' ,
    `val` BIGINT    COMMENT 'val' ,
    PRIMARY KEY (name)
)  COMMENT = 'seq';


DELIMITER $$

CREATE  FUNCTION `seq`(seq_name VARCHAR(20)) RETURNS BIGINT
DETERMINISTIC
BEGIN
UPDATE seq SET val = LAST_INSERT_ID(val+1) WHERE NAME = seq_name;
RETURN LAST_INSERT_ID();
END$$

DELIMITER ;


