    `EFFECTIVE` VARCHAR(2) NOT NULL   COMMENT '有效状态' ,
    `CREATETIME` DATETIME NOT NULL   COMMENT '创建时间' ,
    `CREATEUSER` VARCHAR(36) NOT NULL   COMMENT '创建账户' ,
    `FIELDKEY` VARCHAR(255)    COMMENT '界面权限标识' ,
