    `PASSWORDDEFAULTNUM` DECIMAL(16)    COMMENT '密码错误次数' ,
    `PWDLASTMODIFYDATE` DATETIME    COMMENT '密码最后修改时间' ,
    `ISLOCK` VARCHAR(1)    COMMENT '是否锁定' ,
    `ORDERNO` DECIMAL(10)    COMMENT '排序号' ,
    `CREATEUSER` VARCHAR(36)    COMMENT '创建人' ,
